import React from "react";

import "./navigation.scss";

const Navigation = () => {
  return (
    <React.Fragment>
      <div className="main-nav">Navigation</div>
      <div className="bottom-nav">Bottom Navigation</div>
    </React.Fragment>
  );
};

export default Navigation;
